import { useDispatch, useSelector } from "react-redux"
import { addprodact } from "./slice/prodact"
function Pordact(){
const prodacts=useSelector((state)=>state.PordactReduser)
const dispatch=useDispatch()
return(
<div>
<button onClick={()=>dispatch(addprodact({id:2,title:"sdsd"}))}>AddProdact</button>
{prodacts.map((pro)=>(<h1 key={pro.id}>{pro.title}</h1>))}
</div>
     )
}
export default Pordact
